import React, { useEffect, useState } from "react";
import { orderAPI } from "../services/api";
import { useNavigate } from "react-router-dom";
import "./RetailerOrders.css";

const RetailerOrders = () => {
  const navigate = useNavigate();

  const [orders, setOrders] = useState([]);
  const [retailer, setRetailer] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    try {
      const rawUser = localStorage.getItem("user");
      const userType = localStorage.getItem("userType");

      if (!rawUser || userType !== "retailer") {
        navigate("/retailer/login");
        return;
      }

      const parsed = JSON.parse(rawUser);
      setRetailer(parsed);
      loadOrders(parsed.id);

    } catch (err) {
      console.error("Auth error:", err);
      navigate("/retailer/login");
    }
  }, [navigate]);

  const loadOrders = async (retailerId) => {
    try {
      const res = await orderAPI.getRetailerOrders(retailerId);
      setOrders(res.data || []);
    } catch (err) {
      console.error("Error loading orders:", err);
    } finally {
      setLoading(false);
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return "‚Äî";
    const d = new Date(dateString);
    if (isNaN(d)) return "‚Äî";
    return d.toLocaleString("en-IN", {
      dateStyle: "medium",
      timeStyle: "short",
    });
  };

  return (
    <div className="orders-page">
      <div className="orders-header">
        <button
          className="back-btn"
          onClick={() => navigate("/retailer/dashboard")}
        >
          ‚Üê Back
        </button>

        <h1 className="page-title">üì¶ My Orders</h1>

        <p className="welcome-text">
          Welcome, <b>{retailer?.storeName || retailer?.name}</b>
        </p>
      </div>

      <div className="orders-container">
        {loading ? (
          <div className="loading">Loading orders...</div>
        ) : (
          <table className="orders-table">
            <thead>
              <tr>
                <th>Order ID</th>
                <th>Date</th>
                <th>Total</th>
                <th>Payment</th>
                <th>Status</th>
                <th>View</th>
              </tr>
            </thead>

            <tbody>
              {orders.length === 0 ? (
                <tr>
                  <td colSpan="6" className="no-orders">No orders found</td>
                </tr>
              ) : (
                orders.map((o) => (
                  <tr key={o.id}>
                    <td>{o.id}</td>
                    <td>{formatDate(o.createdAt)}</td>
                    <td>‚Çπ{o.totalAmount?.toFixed(2)}</td>
                    <td>{o.paymentMethod}</td>
                    <td className={o.paymentStatus === "PAID" ? "paid" : "pending"}>
                      {o.paymentStatus}
                    </td>

                    <td>
                      <button
                        className="view-btn"
                        onClick={() => navigate(`/order-details/${o.id}`)}
                      >
                        üîç View
                      </button>
                    </td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default RetailerOrders;
